import React, { useState } from 'react';
import './App.css';
import Table from './components/Table';

function App() {
  const [selectedProvince, setSelectedProvinsi] = useState(null);

  const handleProvinsiSelect = (provinsi) => {
    setSelectedProvinsi(province);
    // Lakukan sesuatu dengan province yang dipilih
    console.log(`Anda memilih provinsi: ${province}`);
  };

  return (
    <div className="body">
      <Table judul="Data Provinsi" onSelectProvince={handleProvinceSelect} />
    </div>
  );
}

export default App;
